import React from "react";

const Header = () => {
  return (
    <header>
      <div className="header">
        <h1 className="first-header">Remembering Abah...</h1>
        <h2 className="first-header-text">
          through our fond memories together
        </h2>
      </div>
    </header>
  );
};

export default Header;
